var product = RED.util.cloneMessage(flow.get('Product'));

msg.headers = {};
msg.headers['User-Agent'] = 'request';
msg.url = "https://api.github.com/repos/guillaumetournabien/" + product + "/releases"
return msg;

var updates = {};
updates.payload = [];

msg.payload.forEach(function(item,index){
    updates.payload[index] = {"Version":item.tag_name, "Changes":item.body, "Published_Date":item.published_at, "URL_Download":item.zipball_url};
    updates.payload[index].Published_Date = updates.payload[index].Published_Date.slice(0,10);
    updates.payload[index].Changes = updates.payload[index].Changes.split('*');
    updates.payload[index].Changes.shift();
});

flow.set('Updates',updates.payload);

return updates;

var updates = {};
