let latest = msg.payload[0].Version.split('.');

var temp = {};
temp.payload = {};

for (let index = 0; index < 3; index++) {

    if (current[index] > latest[index]) {}

    if (current[index] < latest[index]) {
        temp.payload = "Update available !"
    }

    if (current[index] === latest[index]) {}
}

return temp;

